import React from "react";
import { Route, Routes } from "react-router";

import HomePage from "./pages/HomePage/HomePage";

const App = () => {
  return (
    <div className="App">
      <Routes>
        <Route />
      </Routes>
      <HomePage />
    </div>
  );
};

export default App;
